module.exports = "<section class=\"body-section-home\">     \n<div class=\"body-section-home-inner\">\n<app-left-side></app-left-side>\n<div class=\"rightBox\">\n\t<div class=\"rightBox-inner db\">\t\t\t\t\t\t\n\t\t<div class=\"flex-wth\">\n\n\n\t\t\t<app-header></app-header>\n\n\t\t\t<section  class=\"slid_tabs mt-5 mb-5 pb-3\"> \n\t\t\t\t<div  class=\"col-sm-12 commonPages\">  \n\t\t\t\t\t<h5 ><span>Deadline & Legalities</span></h5>\n\t\t\t\t\t<p>MyExpert11 initiates deadline at the official match start time. After match deadline, teams cannot be edited/updated for the respective match.</p>\n\t\t\t\t\t<p>MyExpert11 is a skill-based gaming platform and is offered in accordance with Indian laws. There are no shortcuts or cheat codes for quick and easy wins. </p>\n\t\t\t\t\t<br/>\n\t\t\t\t\t<h5 ><span >Equal opportunity for all User</span></h5>\n\t\t\t\t\t<p>The credits required to pick a player are locked for each particular contest and match. The price for each player does not fluctuate based on the performance of the player or their real-life team during the particular contest or the match.</p>\n\t\t\t\t\t<p>All users in selecting a fantasy team for any match are provided with the same budget of 100 credits. All users have access to the database of players and are bound by the same rules while picking the composition of their respective teams, such as the maximum/minimum limits on the number of batsmen, bowlers, wicket-keeper and all-rounders and limits placed on the number of players that can be picked from a particular real-life team.</p>\n\t\t\t\t\t<br/>\n\t\t\t\t\t<h5 ><span >Transparency</span></h5>\n\t\t\t\t\t<p>You can conveniently download the composition of every team in your contest after the deadline in 1-click. Just go to My Contests tab and you will see a PDF icon on every contest you have joined. Click on this and you will be able to view and/or save all teams in that contest. This feature allows you to keep track of your competition and never have to worry about any changes in anyone’s team post deadline!</p>\n\t\t\t\t\t<br/>\n\t\t\t\t\t<h5 ><span >Winner Declaration</span></h5>\n\n\t\t\t\t\t<p>We love to see you win! To ensure you can play on MyExpert11 and compete with other users with full confidence, we have taken the following measures:</p>\n\t\t\t\t\t<p>The scoring system used for calculating points is clearly illustrated and displayed on our platforms</p>\n\t\t\t\t\t<p>The applicable payouts for winners of each contest are clearly mentioned</p>\n\t\t\t\t\t<p>Any winnings/payouts are promptly processed and credited to the User's account</p>\n\t\t\t\t\t<p>Scores for each match are sourced from accurate scoring feeds provided by reputable third party service providers</p>\n\t\t\t\t\t<br/>\n\t\t\t\t\t<h5 ><span >Responsible game play</span></h5>\n\n\t\t\t\t\t<p>We do not allow Creation of multiple accounts by one user and Submission of fake documents or uploading someone else's documents.</p>\n\t\t\t\t\t\t<p>We do not allow users below 18 years of age to play in the pay-to-play contests on MyExpert11.</p>\n\t\t\t\t\t\t<p>We do not allow Creation of multiple accounts by misusing a referral code to get cash bonus.</p>\n\t\t\t\t\t\t<p>We do not allow or promote cash transactions on MyExpert11.</p>\n\t\t\t\t\t\t<p>Our users trust us with their personal documents like PAN Cards and Bank details. We value & uphold that trust in high esteem. The information shared with us is only used for the user verification purposes and is never disclosed to any outside parties.</p>\n\t\t\t\t\t\t<p>We work with trusted third-party payment gateways with secure authentication to ensure safety and security of all financial transactions. We do not store your credit/debit card details with us.</p>\n\t\t\t\t\t\t<p>We understand that being accessible to our users builds trust and provides security. So, we've made it easier for them to Contact Us so that their queries are addressed on a timely basis.</p>\n\t\t\t\t\t\t\n\t\t\t\t</div>\n\t\t\t</section>\n\t\t</div>\n\t</div>\n\t\t\t\n\t\t\t<app-footer></app-footer>\n\t\t\t\n\t\t</div>\n\t</div>\n</section>\n"

